import React, { useState, useEffect } from 'react'
import PlayerDataService from "../services/playersService";
const TournamentResults = (props) => {
    const initialPlayerState = {
        _id: null,
        name: "",
    }
    
    const playersList = []
    //const [player, setPlayer] = useState(initialPlayerState);

    const getPlayersList = () => {
        for(let i=0; i < props.scorecards.length; i++){
            PlayerDataService.get(props.scorecards[i].playerId)
                .then(response => {
                    playersList.push(response.data)
                })
        }
        console.log(playersList)
        playersList.map(player => {
            console.log(player.name)
        })
    }

    useEffect(() => {
        getPlayersList()
    })

    return(
        <div>
            <div>
                Yes
            </div>
            <div>
                {playersList.map(player => {
                    return(
                        <div>{player.name}</div>
                    )
                })}
            </div>
        </div>
    )
}
export default TournamentResults
